import { useState } from "react";
export default function Form(){
    const [name, setName] = useState({firstName: "Josie", });
    function handleChange(e){
        setName(e.target.value);
    }
    return(
        <div>
            <form>
                <input onChange={(e) => handleChange(e)} type="text" value={name}/>
            </form>
        </div>
    );
}
